import dollarUSLocaleNoDigits from "../../utils/dollarUSLocaleNoDigits";

const OutputsTCO = ({ gasZTR, cashPurchase, NGBRWithFlexiblePowerProgram }) => {
  return (
    <section class="output-versus coh-container ssa-component coh-component split-background coh-style-feature-block coh-style-margin-bottom-none">
      <div
        class="coh-container section coh-style-section"
        //data-gs-background-color="dark-grey"
        data-gs-spacing="none"
        data-gs-min-height=""
        data-gs-overlay=""
        data-gs-foreground-color="light"
        data-gs-remove-spacing=""
      >
        <div class="coh-container section-inner">CTA</div>
      </div>
    </section>
  );
};

export default OutputsTCO;
